def knight_min_health(dungeon):
    m, n = len(dungeon), sum(1 for x in dungeon if x)
    dp = [[0] * n for _ in range(m)]
    dp[0][0] = dungeon[0][0]
    for i in range(m):
        dp[i][0] = dp[i][n - 1] + dungeon[i][0]
    for j in range(n):
        dp[0][j] = dp[m - 1][j] + dungeon[0][j]
    for i in range(1, m):
        for j in range(1, n):
            dp[i][j] = max(dp[i - 1][j], dp[i][j - 1]) + dungeon[i][j]
    return dp[m - 1][n - 1]

