    temp_3 = 1 / (2 * (temp_1 - 1))
    if temp_2 >= temp_3:
        return temp_1
    temp_4 = temp_2 + temp_3
    temp_5 = temp_2 + temp_3 - temp_4 * temp_3
    for temp_6 in range(temp_7, 0, -1):
        temp_8 = temp_5 / (temp_6 + 1)
        if temp_8 > temp_5 / 2:
            temp_5 = temp_8
        else:
            temp_5 -= temp_8
    return temp_5

