    k = desires[2]
    x = desires[0]
    y = desires[1]
    if k == 1:
        return len(desires)
    if k == 2:
        return sum(1 for i in desires if i == 0)
    if x == 0 or y == 0:
        return 0
    if x > k:
        x = k
    if y > k:
        y = k
    return sum(1 for i in desires if min(x, y) <= i <= max(x, y))

