def bootstrap(f, stack=[]):
    def wrappedfunc(*args, **kwargs):
        if stack:
            return f(*args, **kwargs)
        else:
            to = f(*args, **kwargs)
            while True:
                if type(to) is GeneratorType:
                    stack.append(to)
                    to = next(to)
                else:
                    stack.pop()
                    if not stack:
                        break
                    to = stack[-1].send(to)
            return to
    return wrappedfunc

class fenwick_tree:

    def __init__(self, n):
        self.n = n
        self.tree = [0] * n

    def query(self, i):
        res = 0
        while i < self.n:
            res = res + self.tree[i]
            i = i | (i + 1)
        return res

    def update(self, i, x):
        while i < self.n:
            self.tree[i] = x
            i = i | (i + 1)

    def find_kth(self, k):
        x = 0
        while 2 * x + 1 < self.n:
            x = x + 1
        return self.tree[x] + k

