import math


def is_prime(n):
    if n == 1:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True


def get_prime_factors(n):
    prime_factors = []
    for i in range(2, n + 1):
        if is_prime(i):
            prime_factors.append(i)
    return prime_factors


def get_prime_factors_set(factors):
    prime_factors_set = set()
    for factor in factors:
        prime_factors_set |= set([factor])
    return prime_factors_set


def get_largest_prime_factor(n):
    while n > 1:
        prime_factors = get_prime_factors(n)
        prime_factors_set = get_prime_factors_set(prime_factors)
        if len(prime_factors_set) == 1:
            return n
        n = n // prime_factors_set.pop()
    return 0


