def ladder_length(s, t):
    dict = set()
    for word in list(s):
        dict.add(word)
    if word == t:
        return 0
    if s == t:
        return -1
    steps = 0
    word = t
    while word != s:
        dict.add(word)
        for i in range(len(word)):
            new_word = word[:i] + chr(ord(word[i]) + 1) + word[i + 1:]
            if new_word in dict:
                word = new_word
                steps = steps + 1
                break
    return steps

