def frog(n, m, a):
    q = [(0, 0)]
    visited = {(0, 0)}
    while q:
        i, j = q.pop()
        if a[i][j] == 'S':
            return 1
        if a[i][j] == 'T':
            return 0
        for x, y in [(i - 1, j), (i + 1, j), (i, j - 1), (i, j + 1)]:
            if 0 <= x < n and 0 <= y < m and (x, y) not in visited:
                q.append((x, y))
                visited.add((x, y))
    return -1

