def score(a, b, c):
    if a == b == c:
        return [a, b, c]
    if a == 0:
        return [c, c - b, b]
    if b == 0:
        return [a, a - c, c]
    if c == 0:
        return [a - 1, a - 2, a]
    if a + b + c == 180:
        return score(a - 1, b - 2, c - 3)
    if a + b + c < 180:
        return score(a - 1, b - 1, c - 2)

def find(a, b, c):
    return score(a, b, c) if a <= 180 and all(x <= 180 for x in score(a, b, c)) else 'impossible'

